        left: 10px
    }
}

@media (max-width:575px) {
    .service img {
        display: none
    }

    .calc-mini {
        max-width: 330px
    }
}

@media (max-width:500px) {
    .popup .popup-content {
        left: 18%
    }

    .portfolio-content {
        height: 240px
    }
}

@media (max-width:448px) {
    body nav {
        width: 100%
    }

    body .active-menu {
        -webkit-transform: translateX(0);
        transform: translateX(0)
    }

    body .underline {
        width: 100%
    }

    body h1 {
        font-size: 2.2rem
    }

    body h2 {
        font-size: 2rem
    }

    body .description {
        font-size: 1.5rem
    }

    main header {
        padding-bottom: 0
    }

    main header .phone-media img,
    main header .phone-media small {
        display: none
    }

    main header .menu,
    main header .phone-media .phone {
        margin-top: 1rem
    }

    main header .menu small {
        display: none
    }

    .service .form-btn {
        width: 16rem;
        height: 5rem
    }

    .process p {
        font-size: 1.8rem
    }

    .command img {
        width: 100%
    }

    .popup .popup-content {
        left: 15%;
        width: 100%
    }

    .portfolio-btn {
        width: 35px;
        height: 35px
    }

    .portfolio-btn.next {
        right: 5px
    }

    .portfolio-btn.prev {
        left: 5px
    }
}
